import React, { Component } from 'react';
import './App.css';
import Form from './Form.js';

class App extends Component {

  constructor (props) {
    super(props);
    this.state = {
      username: '',
      formSubmitted: false,
      data: '',
    };
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={ require('./images/gh2.png') } className="App-logo" alt="logo" />
          <Form username={this.state.username}/>
        </header>
      </div>
    );
  }
}

export default App;
